  false,\n\t\"url\": null,\n\t\"notes\": \"Belt transects along 1 or 2 consecutively-placed,
  25m transect lines were surveyed as part of Rapid Ecological Assessments conducted
  at 10 sites at Ofu and Olosega Islands in American Samoa in February/March, 2006
  from the NOAA vessel Hi'ialakai (HI06-02). Raw survey data included colony counts
  and size classes by genus, and visual estimation of percent cover. Half a meter(
  0.5m) on each side of the transect lines were included in the belt (for a total
  of 25m2 or 50m2 per site), depending on colony density.\",\n\t\"license_title\":
